PARA TODOS OS GRUPOS: 
Histórico escolar de Ensino Médio, com certificado de conclusão (ficha 19) ou equivalente; 
Documento de identificação oficial com foto (Ex. RG, CNH e CTPS Modelo Novo);
CPF;
Comprovante de quitação eleitoral ou certidão negativa de quitação eleitoral, se maior de 18 anos; 
Documento comprobatório de regularidade com o Serviço Militar, para maiores de 18 anos e do sexo masculino;
01 (uma) foto 3x4 atual; 
Comprovante de Residência (atualizado dos últimos três meses, se possível recibo de água ou luz); 
Declaração de autorização de imagem (opcional);
Procuração simples (quando a matrícula for realizada por terceiros). 

INFORMAÇÕES COMPLEMENTARES

É proibido uma mesma pessoa ocupar, na condição de aluno, simultaneamente, no curso de graduação, 2 (duas) vagas, no mesmo curso ou em cursos diferentes em uma ou mais de uma Instituição Pública de Ensino Superior em todo o território nacional, conforme legislação em vigor. O aluno deverá preencher, no ato da matrícula, declaração de que não possui vínculo em Instituição Pública de Ensino Superior. 

É facultado ao aluno cursar simultaneamente um curso Técnico de Nível Médio e um curso de nível Superior desde que já possua o Ensino Médio ou Equivalente. 

Após a matrícula, o IF Sertão-PE procederá à análise da documentação apresentada pelos candidatos classificados. A constatação de quaisquer irregularidades na documentação implicará na desclassificação do aluno a qualquer tempo, sem prejuízo das medidas legais cabíveis.

